import Card from "./Card";
import "./Middle-Section.css";

const Middle = () => {
  return (
    <div className="background">
      <div className="card-div">
        <Card top="3" bottom="CLIENTS HELPED"></Card>
        <Card top="20k" bottom="TOTAL AD SPEND" />
        <Card top="01" bottom="SERVICES OFFERED" />
      </div>
    </div>
  );
};

export default Middle;
